import React from "react";

const SellBetter = () => {
  return (
    <>
      <div className="flex items-center justify-center h-full">
        <div className="text-center">
          {/* "Sell" Text */}
          <h1 className="text-6xl font-bold text-white">Sell</h1>
          {/* "Better" Text with Gradient */}
          <h1 className="text-6xl font-bold bg-gradient-to-r from-pink-500 via-purple-500 to-blue-500 text-transparent bg-clip-text">
            Better
          </h1>
        </div>
      </div>
      <div className="bg-black text-white py-10">
        <div className="max-w-4xl mx-auto px-4 text-center">
          <h2 className="text-gray-400 text-2xl">A collective of</h2>
          <h1 className="text-5xl font-bold mt-2">AI agents</h1>
          <p className="text-gray-300 mt-4 text-lg">
            Think of these agents as your remote team. They work 24/7 to
            generate new media for your products, that stick with your
            customers.
          </p>
        </div>
      </div>
    </>
  );
};

export default SellBetter;
